let data = [
    {
    id : 1,
    text : "주기적으로 새로운 친구를 만든다",
    },
   
    
    {
    id : 2,
    text : "자유 시간 중 상당 부분을 다양한 관심사를 탐구하는데 할애한다",
    }
]

export default data;
